    false,nt"url": null,nt"notes": "This narrative report for Okefenokee National
    Wildlife Refuge summarizes Refuge activities from September through December of
    1959.  The report begins with a summary of the weather, water, and habitat conditions
    during the period.  Wildlife- including migratory birds, upland game birds, big
    game animals, fur animals, predacious birds, fish, and reptiles- is also covered.
     The report includes a Refuge development and maintenance section which discusses
    physical developments, plantings, and control of vegetation.  Resource management
    is outlined; topics include timber removal and concessions.  A progress report on
    field investigations and applied research is also provided.  The public relations
    section of the report discusses recreational uses, Refuge visitors, Refuge participation,
    and violations.  Items of interest, N-R forms, and photographs are provided at the
    end of the report.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
